import React from 'react';
import styled from 'styled-components';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';

const AppContainer = styled.div`
  font-family: 'Inter', sans-serif;
  overflow-x: hidden;
`;

function App() {
  return (
    <AppContainer>
      <Navbar />
      <HeroSection />
    </AppContainer>
  );
}

export default App;
